// References (these must be multibyte or non-equal-to-any-string-yet-equal-to-themself values)
var EOF = "<Something expected near EOF>";
var BOF = "<Something expected near BOF>";

// Helpers
function IsWhitespace( c ) {
	return c == " " || c == "\f" || c == "\t" || c == "\v" || c == "\r" || c == "\n";
}

function IsLetter( c ) {
	return c != EOF && c.match( /^[A-Za-z_]$/ );
}

function IsDigit( c ) {
	return c != EOF && c.match( /^[0-9]$/ );
}

function IsAlphaNumeric( c ) {
	return c != EOF && c.match( /^[A-Za-z0-9_]$/ );
}

// Bulk
function Highlight( elem ) {
	var input_buf = elem.textContent.split( "" );

	elem.innerHTML = "";

	var i = -1;
	var prev, cur, next, next2;

	function Next() {
		i++;

		prev2	= prev || BOF
		prev 	= cur || BOF;
		cur 	= input_buf[  i  ] || EOF;
		next 	= input_buf[i + 1] || EOF;
		next2	= input_buf[i + 2] || EOF;

		return cur != EOF;
	}

	function SeekPastWhitespace() {
		while ( IsWhitespace( next ) ) {
			Next();
		}

		Next();
	}

	// Hacky
	while ( Next() ) {

		// Whitespace
		if ( IsWhitespace( cur ) ) {

			var contents = cur;

			while ( IsWhitespace( next ) && Next() ) {
				contents += cur;
			}

			var node = document.createElement( "span" );
			node.textContent = contents;

			elem.appendChild( node );

			continue;
		
		}

		// Numerical Literals
		if ( IsDigit( cur ) || ( cur == "." && IsDigit( next ) ) ) {
			var contents = cur;

			while ( ( IsAlphaNumeric( next ) || next == "." ) && Next() ) {
				contents += cur;
			}

			var node = document.createElement( "span" );
			node.textContent = contents;
			node.className = "number";
			elem.appendChild( node );

			continue;

		}

		// Identifiers & Keywords
		if ( IsLetter( cur ) ) {

			var master = document.createElement( "span" );
			var node = document.createElement( "span" );
			var contents = cur;
			var firstIndex = true;

			while ( ( IsAlphaNumeric( next ) || ( cur != "." && next == "." ) ) && Next() ) {

				if ( cur == "." ) {
					// Append current identifier block
					node.textContent = contents;
					node.className = firstIndex && TK[contents] || ""; // If this is a constant and the first indexee, highlight it
					master.appendChild( node );

					// Append index operator
					var dotNode = document.createElement( "span" );
					dotNode.textContent = cur;
					dotNode.className = TK[cur];
					master.appendChild( dotNode );

					// Begin next identifier block
					node = document.createElement( "span" );
					contents = "";

					firstIndex = false;
				} else {
					contents += cur;
				}

			}

			node.textContent = contents;
			master.appendChild( node );
			master.className = TK[master.textContent] || "identifier";

			if ( master.className == "identifier" ) {

				// Check if this identifier is being called or indexed
				var original_i = i;

				SeekPastWhitespace();

				if ( cur == "(" || cur == "{" || cur == "'" || cur == "\"" || ( cur == "[" && ( next == "[" || next == "=" ) ) ) {
					master.className = "function";

					var sub_master = master;
					
					if ( FUNCTIONS[sub_master.textContent] ) {
						master = document.createElement( "a" );
						master.href = "//wiki.garrysmod.com/page/" + FUNCTIONS[sub_master.textContent];

						master.appendChild( sub_master );
					}

				}

				i = original_i; // Jump back to the current pointer
				
			}

			elem.appendChild( master );

			continue;

		}

		// Quote-Strings
		if ( cur == "'" || cur == "\"" ) {

			var delim = cur;

			var master = document.createElement( "span" );
			var node = document.createElement( "span" );

			var contents = cur;

			while ( Next() && cur != delim ) {

				// Handle escape sequence
				if ( cur == "\\" && next != EOF ) {
					// Append partial string
					node.textContent = contents;
					master.appendChild( node );

					// Append escape sequence
					var escapeNode = document.createElement( "span" );
					escapeNode.textContent = cur + next;

					// Hackily handle hex escape sequences
					if ( next == "x" ) {
						for ( var j = 0; j < 2; j++ ) {
							Next();

							if ( next != EOF )
								escapeNode.textContent += next;
						}
					}

					escapeNode.className = "escape";
					master.appendChild( escapeNode );

					// Begin next partial string
					node = document.createElement( "span" );
					contents = "";

					// Skip over escape sequence
					Next();

					continue;
				}

				if ( cur != EOF )
					contents += cur;

			}

			// Eat delimiter
			if ( cur != EOF )
				contents += cur;

			node.textContent = contents;
			master.appendChild( node );
			master.className = "string";
			elem.appendChild( master );

			continue;

		}

		// Multiline String & Comment
		if ( ( cur == "-" && next == "-" && next2 == "[" ) || ( cur == "[" && ( next == "=" || next == "[" ) ) ) {
			var original_i = i;
			var class_name = "string";
			var contents = cur;

			if ( cur == "-" ) {
				class_name = "comment";
				contents += "-[";
				Next(); Next(); // Bring us up to the multiline beast
			}

			var delim_len = 0;

			while ( next == "=" && Next() ) {
				delim_len++;
				contents += cur;
			}

			Next(); // Skip end of delimiter
			contents += cur;

			while ( Next() ) {
				contents += cur;

				// Search for end delimiter
				if ( delim_len == 0 && cur == "]" && next == "]" )
					break

				if ( delim_len != 0 && cur == "]" ) {
					var remaining = delim_len

					while ( next == "=" && Next() ) {
						contents += cur;
						remaining--;
					}

					if ( next == "]" && remaining == 0 )
						break;
				}
				
			}

			Next(); // Gobble end of delimiter
			contents += cur;

			var node = document.createElement( "span" );
			node.textContent = contents;
			node.className = class_name;
			elem.appendChild( node );

			continue;

		}

		// Single-Line Comment
		if ( ( cur == "-" && next == "-" ) || cur == "/" && next == "/" ) {

			var contents = cur;

			while ( next != "\r" && next != "\n" && Next() ) {
				contents += cur;
			}

			var node = document.createElement( "span" );
			node.textContent = contents;
			node.className = "comment";
			elem.appendChild( node );

			continue;

		}

		// Multi-Line C Comment
		if ( cur == "/" && next == "*" ) {
			var contents = cur;

			while ( ( prev != "*" || cur != "/" ) && Next() ) {
				console.log( cur );
				contents += cur;
			}

			var node = document.createElement( "span" );
			node.textContent = contents;
			node.className = "comment";
			elem.appendChild( node );

			continue;

		}

		// Two-Char Operators
		if ( next != EOF && TK[cur + next] ) {

			var node = document.createElement( "span" );
			node.textContent = cur + next;
			node.className = TK[cur + next];
			elem.appendChild( node );

			Next();

			continue;

		}

		// Single-Char Operators & Errors
		var node = document.createElement( "span" );
		node.textContent = cur;
		node.className = TK[cur] || "error";

		elem.appendChild( node );

	}
}